import React, { Component } from 'react'

export default class Cart extends Component {
    render() {
        const {cartItems} = this.props;
        return (
            <div>
                {cartItems.length === 0 ? (
                    <div className="cart">
                        Cart is empty</div>
                ) : (
                    <div className="cart">
                        You have {cartItems.length} in the cart {" "}
                    </div>
                )}
            </div>
        )
    }
}
